import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import '../TopNav/TopNav.css'


import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'


export default class TopNav extends Component {
    render() {
        return (
            <Navbar collapseOnSelect expand="xl" className="NavBar">
                <Navbar.Brand href="#home" className="brand">Kanta Husari</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse >
                    <Nav className="links">
                        <Link href="#features" className="link01">Features</Link>
                        <Nav.Link href="#pricing" className="link02">Pricing</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}
